Information
------------------------------

The Nature Of Things: Save My Lake
Imagine you're taking a walk along the beach on a beautiful summer's day. If the beach in question is along the shores of Lake Winnipeg, the 10th-largest freshwater lake in the world, you could be in for a surprise. Instead of sandy beaches you find a thick, green sludge reminiscent of pea soup. Suppose your dog thirstily laps up the water and winds up dead an hour later (that's exactly what happened to one beach-goer's beloved pet in 2009). What is happening to this once-pristine lake? As biologist Al Kristofferson says, &quot;We all assumed, somewhat naively, that nothing would happen to Lake Winnipeg. Well, it did.&quot;
Lake Winnipeg has long been a beloved destination for vacationers and cottage owners. For generations, it has been a recreational hub for families, residents of Manitoba and tourists. It is also home to an important fishery. Those who have experienced and enjoyed Lake Winnipeg have a strong, personal connection to its vast beauty and depend on its productivity. But we know very little about it. Save My Lake plunges into the science and environmental factors behind the slow death of spectacular Lake Winnipeg.

